import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Tracker from './pages/Tracker';
import Schedule from './pages/Schedule';

function App() {
  const [selectedRoute, setSelectedRoute] = useState('');

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home selectedRoute={selectedRoute} setSelectedRoute={setSelectedRoute} />} />
        <Route path="/tracker" element={<Tracker selectedRoute={selectedRoute} />} />
        <Route path="/schedule" element={<Schedule selectedRoute={selectedRoute} />} />
      </Routes>
    </Router>
  );
}

export default App;
